Najprej uporabimo pravilo o množenju zradnikov, da izračunemo vrednost radikalnega konjugata: \begin{align*}
(5+\sqrt{3})(5-\sqrt{3})&=5^2-\sqrt{3}^2\\
&=25-3\\
&=\boxed{22}.
\end{align*}

V $70\text{'s}$ je bila ponovno $12$ centov za Brazilija in $12$ centov za Franca, $6$ centov za Peru in $10$ centov za Španije. V totalnosti je bila ponovno $12+12+6+10=40$ centov za vsa tri državi. Vseh znamk je bila $12+12+6+10=40$. V prevojni cenetočki je bila $40/40=1$ cent.  \[
\boxed{1}
\]

Vsota 27 zaporednih pozitivnih celih števil je enaka $3^7 = 2187$. Vseh zaporednih števil je $27$, kar pomeni, da je mediana enaka $27/2 = 13.5$. V tem primeru mediana je enaka 13.5.  \[
\boxed{13.5}
\]

V srečanju se seštevamo vse rokovanja, ki so izvedli od vsakih čarovnic. Vseh čarovnic so 6, zato se izvede $6 \cdot 10 = 60$ rokovanj. Vseh čarovnikov so 10, zato se izvede tudi $10 \cdot 6 = 60$ rokovanj. Vse rokovanja se izvede dvekr, ker se kaže, da se nekako rokani z drugim čarovnikom. Vnesemo tudi preprostost, da se nekako rokani z drugim čarovnikom, zato se izračunujemo $60 + 60 - 10 \cdot 6 = 60$. V srečanju se zgodilo 60 rokovanj.  \[
\boxed{60}
\]
